import "./Registration.css";
import React from "react";

function template() {
  const {name,location,myclass}=this.state.data; 

  return (

    <div className="registration comtainer-fluid mb-5">
      <h1 className="text center mb-1">---------Registration---------</h1>
      <div>Enter Name:<input value={name} id="name" onChange={this.fn.bind(this)}/></div>
      <div>Enter Class:<input value={myclass}id="class" onChange={this.fn.bind(this)}/></div>
      <div>Enter Location:<input value={location} id="location" onChange={this.fn.bind(this)}/></div>
      <button className="btn-primary">Register</button>
    </div>
  );
};

export default template;
